import React from 'react';
import { Link } from 'react-router-dom';

import Header from '../../components/header/header';
import TrailsView from '../../components/trailsview/trailsview';

// import Directory from '../../components/directory/directory.component';

import './homepage.css';

const HomePage = () => (
   <div className='homepage'>
      <Header currentPg="home" />
      <img src="/home/matte/Coding/uhg/b0_react/src/images/pexels-photo-1578750.jpeg" alt="lost" class="trailImage" />
      <TrailsView list="beginner" />
      <TrailsView list="popular" />
   </div>
);

export default HomePage;
